script: |
  super -f text -I q1680.spq | sort > q1680.out

inputs:
  - name: q1680.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE - col2 NOT BETWEEN + col2 * + col1 * + ( - 44 ) AND + - 71;
  - name: tab1

outputs:
  - name: q1680.out
    data: |
      85	5	59
      91	47	68
